import TotalPointsCard from '../cards/TotalPointsCard'
import TotalSolvedCard from '../cards/TotalSolvedCard'
import VizCard from "../cards/VizCard"
import DunCard from "../cards/DunCard"
import LangCard from "../cards/LangCard"
import Box from '@mui/material/Box';
import Container from '@mui/material/Container';
import Grid from '@mui/material/Grid';

const DisplayUserData = ({totalSolved, totalPoints, languages}) => {
    return (
        <>
    <Box
      sx={{
        minHeight: '100%',
        py: 1
      }}
    >
      <Container maxWidth={true}>
        <Grid
          container
          spacing={0}
        >
          <Grid
            item
            lg={3}
            sm={6}
            xl={3}
            xs={12}
            sx={{boxShadow:3}}
          >
            {(languages && totalSolved && totalPoints) &&
            (<TotalPointsCard totalPoints = {totalPoints}/>)}
          </Grid>
          <Grid
            item
            lg={3}
            sm={6}
            xl={3}
            xs={12}
          >
          {(languages && totalSolved && totalPoints) &&
            (<TotalSolvedCard totalSolved = {totalSolved}/>)}
          </Grid>
          <Grid
            item
            lg={3}
            sm={6}
            xl={3}
            xs={12}
          >
            {(languages && totalSolved && totalPoints) &&
            (<LangCard 
                languages = {languages}
                totalSolved = {totalSolved}
            />)}
          </Grid>
          <Grid
            item
            lg={3}
            sm={6}
            xl={3}
            xs={12}
          >
            {/*<TotalProfit sx={{ height: '100%' }} />*/}
          </Grid>
          <Grid
            item
            lg={12}
            md={12}
            xl={12}
            xs={12}
          >
            {(languages && totalSolved && totalPoints)&&(
            <VizCard 
                totalPoints = {totalPoints}
                totalSolved = {totalSolved}
                languages = {languages}    
            />)}
          </Grid>
          <Grid
            item
            lg={4}
            md={6}
            xl={3}
            xs={12}
          >
            {(languages && totalSolved && totalPoints)&&(
            <DunCard
                languages = {languages}
                totalPoints = {totalPoints}
                totalSolved = {totalSolved}
            />
            )}
          </Grid>
          <Grid
            item
            lg={4}
            md={6}
            xl={3}
            xs={12}
          >
            {/*<LatestProducts sx={{ height: '100%' }} />*/}
          </Grid>
          <Grid
            item
            lg={8}
            md={12}
            xl={9}
            xs={12}
          >
            {/*<LatestOrders />*/}
          </Grid>
        </Grid>
      </Container>
    </Box>
  </>
    );
}

export default DisplayUserData;
